import React from 'react';
import ReactDOM from 'react-dom';
import { Router } from 'react-router-dom'
import App from './components/App'

document.addEventListener('DOMContentLoaded', ()=> {
    ReactDOM.render( 
        <Router>
            <App />, document.getElementById("root")
        </Router>
    );
})
